import React from 'react';
import { Box, Container, Typography, Grid } from '@mui/material';
import './projects.css';

const projects = [
  {
    title: 'Vocational Training',
    description: 'Vocational training is one of the tools of accelerating economic growth and alleviating poverty in developing countries such as Malawi. As There is Hope, we subscribe to that notion, so much so that we tailor our vocational programme towards the youth, who are seen as the drivers of economic growth – being the largest group of the population in Malawi.',
    image: '/path/to/vocational-training-image.jpg', // Replace with the actual path to your image
  },
  {
    title: 'Leadership Development Program',
    description: 'For change to effectively take root in a rural African setting, the whole community must be actively involved in the process. This program seeks to develop leadership skills within the community, empowering local leaders to take charge of their own development.',
    image: '/path/to/leadership-development-image.jpg', // Replace with the actual path to your image
  },
  // Add more projects as needed
];

const Projects = () => {
  return (
    <div className="projects-wrapper">
      {/* Header Image Section */}
      <Box className="projects-hero-container">
        <Box className="projects-intro-container">
          <Typography variant="h1" component="h1">
            Our Works
          </Typography>
        </Box>
      </Box>

      {/* Projects Section */}
      <Container>
        <Box my={4}>
          <Grid container spacing={4}>
            {projects.map((project, index) => (
              <Grid item xs={12} key={index} className="project-item">
                <img
                  src={project.image}
                  alt={project.title}
                  className="project-image"
                />
                <Box className="project-content">
                  <Typography
                    variant="h4"
                    component="h3"
                    gutterBottom
                    className="project-title"
                  >
                    {project.title}
                  </Typography>
                  <Typography
                    variant="body1"
                    className="project-description"
                  >
                    {project.description}
                  </Typography>
                </Box>
              </Grid>
            ))}
          </Grid>
        </Box>
      </Container>
    </div>
  );
};

export default Projects;
